import React, { Component } from 'react';


class Dashboard extends Component {
  render(){
    return (
        <div className="dashboard container">
          <div className="row">
            <div className="col s12 m6">
            <img alt='../t1.jpg'/>
            </div>
          </div> 
        </div>
    )
  }
}

export default Dashboard;
